  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR outlines Refuge accomplishments from January through May of 1959. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, and furbearers-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes Refuge visitors and fishing.\",\n\t\"owner_org\":
